const App = () => {
 const cards = [
    { title: 'Carta 1', content: 'Contenido de la carta 1' },
    { title: 'Carta 2', content: 'Contenido de la carta 2' },
    { title: 'Carta 1', content: 'Contenido de la carta 1' },
    { title: 'Carta 2', content: 'Contenido de la carta 2' },
    { title: 'Carta 1', content: 'Contenido de la carta 1' },
    { title: 'Carta 2', content: 'Contenido de la carta 2' },
    { title: 'Carta 1', content: 'Contenido de la carta 1' },
    { title: 'Carta 2', content: 'Contenido de la carta 2' },
    { title: 'Carta 1', content: 'Contenido de la carta 1' },
    { title: 'Carta 2', content: 'Contenido de la carta 2' },
    { title: 'Carta 1', content: 'Contenido de la carta 1' },
    { title: 'Carta 2', content: 'Contenido de la carta 2' },
    // Agrega más cartas según sea necesario
 ];

 return (
    <div className="App">
      <CardList cards={cards} />
    </div>
 );
};

export default App;
